import React, {Component} from 'react';
//import NameForm from './Appinit';
//import ReactDOM from 'react-dom';
//import logo from './logo.svg';
import '././bootstrap/bootstrap.css';



class FirstDiv extends Component {

  fillthenumbers = {
    firstnum: 1
  }


  render(){
    let servicedPage = {
      howpgbuilt:"Site is based on React framework",
      howpgbuilt1: "Works on Bootstrap, Chartjs, js, json",
      howpgbuilt2: "Github is used for Code repo",
      howpgbuilt3: "aws Amplify for Code Deployment",
      howpgbuilt4: "aws Route 53"
    }

    return(
      <div className="FirstDiv">

        <div className="container-fluid bg-light">

          <div className="row bg-secondary ">

          </div>
          <h6 className="text-center">Hi, my name is Osman Morales, I am a soon to graduate Computer Science student. I am seeking a new Life opportunity in the job market, I have gained the skills and confidence to further develop my career and begin applying solutions to
real world problems. For example, this site I made it with the use of bootStrap and React Framework. Although I'm frankly not the best UI Designer, you may find I try
 to enhance my skills by doing. Furthermore, I am seeking a long term opportunity to fit in a company's work model and ethics, by excelling in completing goals, achieving expertise in the field, hence bringing value to the company, customers and business partners.</h6>
          <div><br></br></div>

          <div className="row ">
              <div>
                <a href="https://i.stack.imgur.com/TtOPt.gif" rel="noreferrer"><img src="https://i.stack.imgur.com/TtOPt.gif" alt="enter image description here"></img></a>
              </div>
            </div>

          <div><br></br></div>
          <p className="text-center text-white Lemonada bg-dark elmargen shadow p-3 mb-5 rounded"><h6>The Charts below depict my dynamic skills and years I've been in IT</h6></p>
          <div><br></br></div>

          <div><br></br></div>
          <div>

          </div>


        </div>

      </div>

    )

  }

}
//export default FirstDiv;
export default FirstDiv;
